(692, '/c.g/cg_pgminfo_crud3.php', 'j0a0af1p9kp77319mrjbjti872', NULL, NULL, 'zero12a', 1, 'log_CG', 'INFO', '2', 'prepare sql : \n	update CG_PGMFNC set\n		FNCID = ?, FNCCD = ?, FNCNM = ?, FNCTYPE = ?, USEYN = case ? when 1 then \'Y\' else \'N\' end\n		, FNCORD = ?, USERDEFJS = ?\n		,MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\n  	where PJTSEQ = ? and PGMSEQ = ? and GRPSEQ = ? and FNCSEQ = ?\n		', 'PGMINFO', '20200218054914'),
(693, '/c.g/cg_pgminfo_crud3.php', 'j0a0af1p9kp77319mrjbjti872', NULL, NULL, 'zero12a', 1, 'log_CG', 'INFO', '2', 'full sql : \n	update CG_PGMFNC set\n		FNCID = \'SQLCREATE\', FNCCD = \'USERDEF\', FNCNM = \'MAKE LOCAL SQL\', FNCTYPE = \'\', USEYN = case \'1\' when 1 then \'Y\' else \'N\' end\n		, FNCORD = 5, USERDEFJS = \'var checked=mygridG2.getCheckedRows(0);//table 목록\nif(checked ==\"\"){\n	return;\n}else{\n	//alert(checked);\n	var arrTables = checked.split(\",\");\n\n	var colIndex = mygridG2.getColIndexById(\"RESULT\");\n\n	for(t=0;t<arrTables.length;t++){\n		var tableNm = arrTables[t];\n\n		//alert(tableNm);\n		//alert(\"rowid, 컬럼순번:\" + tableNm + \", \" + colIndex);\n		//불러오기\n		$.ajax({\n			type : \"GET\",\n			url : CFG_CGWEB_URL + \"/c.g/cg_cdeploy_db.php?CTL=MAKELOCALFILE&TOKEN=\" + token + \"&DB=\" + $(\"#G1-DB\").val() + \"&TABLE=\" + tableNm ,\n			dataType: \"jsonp\",\n			privateTableNm : tableNm,\n			async: false,\n			success: function(data){\n				alog(\"   gridG2 json return----------------------\");\n\n				//alog(\"   json RTN_MSG length : \" + data.RTN_MSG.length);\n\n				mygridG2.cells(this.privateTableNm,colIndex).setValue(\"O\");\n				//alert(\"응답오케이:\" + tableNm + \", \" + colIndex);\n\n			},\n			error: function(error){\n				msgError(\"[테이블목록] Ajax http 500 error ( \" + error + \" )\",3);\n				//alog(\"[테이블목록] Ajax http 500 error ( \" + data.RTN_MSG + \" )\");\n			}\n		});\n	}\n}\'\n		,MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\n  	where PJTSEQ = 3 and PGMSEQ = 103 and GRPSEQ = 259 and FNCSEQ = 1311\n		', 'PGMINFO', '20200218054914'),
