(98, 3, 4, 'selDtlG', 'DTL', 3, 'R', 'RTN_SELECT_LIST', 0, 'select\n	CODED_SEQ,CD,NM,CDDESC,PCD,ORD\n	,CDVAL,CDVAL2,CDMIN,CDMAX,DATATYPE\n	,EDITYN,FORMATYN,USEYN,DELYN\n	,ADDDT,MODDT\nfrom CG_CODED\nwhere PCD = #{G2-PCD}\norder by ORD ', 0, '20180325192242', '20190624233317'),
(99, 3, 4, 'insMasG', 'MAS', 3, 'C', 'RTN_INT', 0, 'insert into CG_CODE (\n	PCD,PNM,PCDDESC,ORD\n	,UITOOL,USEYN,DELYN\n	,ADDDT\n) values (\n	#{PCD},#{PNM},#{PCDDESC},if(#{ORD}=\'\',\'10\',#{ORD})\n	,#{UITOOL},if(#{USEYN}=\'\',\'Y\',#{USEYN}),if(#{DELYN}=\'\',\'N\',#{DELYN})\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)', NULL, '20180325193702', '20180716172431'),
(100, 3, 4, 'insDtlG', 'DTL', 3, 'C', 'RTN_INT', 0, 'insert into CG_CODED (\n	CD,NM,CDDESC,PCD\n	,ORD,CDVAL,CDVAL2,CDMIN,CDMAX\n	,DATATYPE,EDITYN,FORMATYN,USEYN,DELYN\n	,ADDDT\n) values (\n	#{CD},#{NM},#{CDDESC},#{PCD}\n	,if(#{ORD}=\'\',10,#{ORD}),#{CDVAL},#{CDVAL2},#{CDMIN},#{CDMAX}\n	,#{DATATYPE},#{EDITYN},#{FORMATYN},if(#{USEYN}=\'\',\'Y\',#{USEYN}),if(#{DELYN}=\'\',\'N\',#{DELYN})\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)', NULL, '20180325194215', '20180716172431'),
(101, 3, 4, 'updMasG', 'MAS', 3, 'U', 'RTN_INT', 0, 'update CG_CODE set\n	PNM = #{PNM}, PCDDESC = #{PCDDESC}, ORD = #{ORD}, UITOOL = #{UITOOL}, USEYN = #{USEYN}\n	, DELYN = #{DELYN}\n	, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere PCD = #{PCD}\n', NULL, '20180325195023', '20180716172431'),
