(138, 3, 68, 'sFromCFG', 'FromCfg', 3, 'R', 'RTN_SELECT_LIST', 10, 'select \n 0 as CHKEDIT,PJTSEQ,CFGSEQ,USEYN,CFGID,CFGNM,MVCGBN,PATH,CFGORD,ADDDT,MODDT\nfrom CG_PJTCFG\nwhere PJTSEQ = #{G1-FROM_PJTSEQ} \n', NULL, '20180712171348', '20180712172845'),
